       <Table.Cell > <h3>{standardName} [{ticker}]</h3></Table.Cell>
       <Table.Cell>${lastPrice} </Table.Cell>
       <Table.Cell >${priceChange} </Table.Cell>

       <Table.Cell >{percentChange}% </Table.Cell>


